import React from "react";
import {CodeBracketIcon} from '@heroicons/react/24/outline'
import CountUp from 'react-countup';
import VisibilitySensor from 'react-visibility-sensor';

const CodingSkills = () => {
    const percentbarstyle = "float-right rounded-full font-semibold px-3 mt-3 bg-gray-200 text-gray-900"
    const stats={
        'SAT': {
          'score':1400,
          'total':1600,
        },
        '10th': {
          'score':467,
          'total':500,
        },
        '12th': {
          'score':485,
          'total':500,
        },
    }
    return (
        <>
            <div className="inline-block px-16 py-12">
                <div className="flex gap-4 items-center">
                    <div>
                        <h1 className="text-5xl text-black font-semibold">Coding Skills</h1>
                    </div>

                    <div>
                    <CodeBracketIcon className="w-12 text-indigo-600"/>
                    </div>
                </div>
            </div>

        </>
    )
}

export default CodingSkills;
